import React, { Component } from "react";

export default class weather extends Component {
  render() {
    return (
      <div>
        <h1>Weather App</h1>
        <form>
          <input type="text" />
          <button type="submit">Get Weather</button>
        </form>
      </div>
    );
  }
}
